import React from 'react';
import './UserSideBar.css'

function UserSideBar() {
  return (
    <div>
      <div className='ad-user-sidebar-wrap'>
      <p>Achievements</p>
          <p>Learning Path</p>
          <p>Discussion Forum</p>
          <p>Help Center</p>
          <p>Account Settings</p>
      </div>
    </div>
  )
}

export default UserSideBar
